import { Table } from 'reactstrap';


class QRstatComp_5 extends Component {
  render(){
    return (
      <div>
        <h1> TEST5 </h1>
        <Table>
        <thead>
          <tr>
            <th>d_seen</th>
            <th>browser</th>
            <th>platform</th>
          </tr>
        </thead>
        <tbody>
        {this.props.data.map((item,i)=>{
          <h1>test</h1>


        })}
          // <tr>
